//-----------------------------------------------Funcoes para integracao com o app mobile----------------------------------------
/**
 * Verifica se a variavel textToSend est vazia.
 */
function ryb_isSelectionEmpty() {
    if (textToSend === "" || textToSend === null || textToSend.length < 1) {
        return true;
    }
    return false;
}


/**
 *  Esta funo realiza o controle da chamada de voz ou libras antes de enviar o Texto para o App.
 * @param actionType (libras ou voz)
 */
function ryb_callMobileLibrasVoz(actionType) {
    ryb_Log("ActionType [" + actionType + "] text[" + textToSend + "] called.");
    ryb_disableButtonsForAMoment();

    if (ryb_isSelectionEmpty()) {

        var rybWarnEmpty = document.getElementById('rybenaWarningEmpty');

        rybWarnEmpty.style.display = "block";

        var tImg = setTimeout(function() {
            rybWarnEmpty.style.display = "none";
        }, 3000);

        document.addEventListener("touchstart", function(event) {
            if (event.target == rybWarnEmpty) {
                rybWarnEmpty.style.display = "none";
                clearTimeout(tImg);
            }
        });

        return;
    }

    // conta a quantidade de cliques nos botes para controle de apresentao do banner Rybena que levar para o download
    clicksRybButtons++;

    // Utilizado apenas no iOS Safari. Verifica se o valor do scroll atual  igual ao scroll recebido pela URL na
    // variavel "s" via GET. Se for igual, incrementa o valor do scroll para que o retorno para o browser funcione.
    if (ryb_getScroll() == scrollTop) {
        scrollTop++;
    }

    // esta funo verifica se possui algo no Local Storage, se no possuir ento o banner Rybena que leva para o
    // download ser apresentado a primeira vez, depois ser armazenado no local Storage
    if (!ryb_isFirstTime()) {

        ryb_clearSelectionMobile(); // limpa-se a seleo para correo de bugs em dispositivos android.

        var modal = document.getElementById('rybenaModal');
        var bttInstalar = document.getElementById('rybenaBtnInstalar');
        var btnFechar = document.getElementById("rybenaBannerClose");

        // Apresenta a modal
        modal.style.visibility = "visible";

        // Se o usurio escolheu a opo instalar, manda para a loja
        bttInstalar.onclick = function() {
            modal.style.visibility = "hidden";
            ryb_setLocalStorage();
            ryb_goToMarket();
        };

        // Se selecionou a opo fechar, manda para o App e grava no Local Storage
        btnFechar.onclick = function() {
            modal.style.visibility = "hidden";
            ryb_setLocalStorage();
            dinamicURI = scheme + "://" + host + "/?actionType=" + actionType + "&scroll=" + scrollTop + "&text=" + textToSend + "&url=" + currentURL;
            ryb_sendText(false);
        };

    } else {


        // Caso no seja a primeiira vez, ento o banner Rybena que leva para loja no ser exibido, a no ser que
        // ocorra do usurio ter clicado em j foi intalado, mas ainda no instalou, o RybClicksController verificar
        // se o usurio realizou algumas tentativa em um certo perodo de tempo, se atender aos critrio, ser
        // apresentado novamente o banner Ryben
        var instance = RybClicksController.getInstance();
        if (instance.getTimerIsOn() === 0) { // se estiver 0, inicia o contador novamente.
            instance.initController();
        }

        dinamicURI = scheme + "://" + host + "/?actionType=" + actionType + "&scroll=" + scrollTop + "&text=" + textToSend + "&url=" + currentURL;
        ryb_sendText(false);
    }
}


/**
 * Esta funo desabilita o boto por alguns instantes para que no acontea do usurio clicar duas ou mais vezes
 * rapidamente e em cada uma dessas vezes chame o app.
 */
function ryb_disableButtonsForAMoment() {
    isButtonsDisable = true;
    timoutButtons = setTimeout(function() {
        isButtonsDisable = false;
        ryb_Log("button Disable");
    }, 300);
}


/**
 * RybClicksController  uma Singleton que controla os cliques para apresentao do banner
 * Ela  apenas util no caso do usurio ter marcado que j possui Rybena instalado, mas ainda no instalou o mesmo.
 */
var RybClicksController = (function() {
    var instance;
    var maxTimes = 2;
    var timeout = 3000;
    var t, c, i = 0;
    var timer_is_on = 0;

    function ryb_createInstance() {
        ryb_Log("create sing");
        initController();
        return this;
    }


    // Thread que apresenta a quantidade de cliques realizadas nos botes de libras ou voz dentro do perodo de tempo
    // definido na varivel timeout
    function ryb_timedCount() {
        t = setTimeout(function() {
            ryb_Log("clicksRybButtons [" + clicksRybButtons + "]");
            ryb_timedCount();
        }, (timeout));
    }

    // Thread que apresenta o banner Rybena caso atenda os requisitos de apresentao da clausula IF.
    // esta Thread executa a busca de cliques de 20 em 20 miliseguntos at chegar no tempo de timeout.
    function ryb_clicksCount() {
        c = setTimeout(function() {
            // Apresenta a modal
            if (clicksRybButtons >= maxTimes && i === 0) {
                i++; // para entrar uma nica vez

                ryb_clearSelectionMobile();
                ryb_Log("textToSend: " + textToSend);

                var modal = document.getElementById('rybenaModal');
                var bttInstalar = document.getElementById('rybenaBtnInstalar');
                var btnInstalado = document.getElementById('rybenaBtnInstalado');
                var btnFechar = document.getElementById("rybenaBannerClose");

                modal.style.visibility = "visible";

                // Se selecionou a opo instalar, manda para a loja
                bttInstalar.onclick = function() {
                    modal.style.visibility = "hidden";
                    ryb_goToMarket();
                };

                // Se selecionou a opo fechar, manda para o App
                btnFechar.onclick = function() {
                    modal.style.visibility = "hidden";
                    ryb_setLocalStorage();
                    dinamicURI = scheme + "://" + host + "/?actionType=libras&scroll=" + scrollTop + "&text=" + textToSend + "&url=" + currentURL;
                    ryb_sendText(false);
                };

            }
            ryb_clicksCount();
            // ryb_Log("contando cliques");
        }, (20));
    }

    function ryb_startThreads() {
        if (!timer_is_on) {
            timer_is_on = 1;
            ryb_timedCount();
            ryb_clicksCount();
        }
    }

    function ryb_stopThreads() {
        clearTimeout(t);
        clearTimeout(c);
        timer_is_on = 0;
        i = 0;
    }

    this.initController = function() {
        ryb_startThreads();
        setTimeout(function() {
            ryb_stopThreads();
        }, timeout);

        // retorna o contador de cliques para 0
        setTimeout(function() {
            clicksRybButtons = 0;
        }, timeout + 200);
    };

    this.getTimerIsOn = function() {
        return timer_is_on;
    };

    return {
        getInstance: function() {
            if (!instance) {
                instance = ryb_createInstance();
            }
            return instance;
        }
    };
})();


/**
 * Verifica se  a primeira vez que o usurio est tentando acessar a funcionalidade do Rybena na pgina
 * @returns {boolean}
 */
function ryb_isFirstTime() {
    var ls = localStorage.getItem("rybMob");
    if (ls == "true") {
        return true;
    } else {
        return false;
    }

}

/**
 *  Inclui o valor no Local Storage
 */
function ryb_setLocalStorage() {

    try {
        var x = 'test-localstorage-' + Date.now();
        localStorage.setItem(x, x);
        var y = localStorage.getItem(x);
        localStorage.removeItem(x);
        if (y !== x) {
            throw new Error();
        }
        localStorage.setItem("rybMob", true);
    } catch (e) {
        console.log("Has no memory storage");
    }
}

